def countLetter(msg):
    letterCount = sorted(BasicFunc.getLetterCount(msg).iteritems(), key = lambda d : d[1], reverse = True)
    return letterCount

def countDigraphs(msg):
    msg = msg.upper()
    # replace
    digraphCount = {}
    for i in range(len(msg) - 1):
        if msg[i : i + 2] not in digraphCount.keys():
            digraphCount[msg[i : i + 2]] = 1
        else:
            digraphCount[msg[i : i + 2]] += 1
    digraphCount = sorted(digraphCount.iteritems(), key = lambda c : c[1], reverse = True)
    return digraphCount

def countTrigraphs(msg):
    msg = msg.upper()
    trigraphCount = {}
    for i in range(len(msg) - 2):
        if msg[i : i + 3] not in trigraphCount.keys():
            trigraphCount[msg[i : i + 3]] = 1
        else:
            trigraphCount[msg[i : i + 3]] += 1
    trigraphCount = sorted(trigraphCount.iteritems(), key = lambda c : c[1], reverse = True)
    return trigraphCount 

def repeatedLetters(countDict):
    repeatedCount = []
    for elem in countDict:
        if elem[0][0] == elem[0][1]:
            repeatedCount.append(elem)
    repeatedCount = sorted(repeatedCount, cmp = lambda x, y : cmp(x[1], y[1]), reverse = True)
    return repeatedCount

